import React from 'react';
import ProjectList from './projectList';

//6 applications with github link and working page link

let projects = [
  {name: "test", image: "link"},
  {name: "test 2", image: "linke 2"}
];

function Portfolio() {

  return (
    <div>
      <h1>Portfolio</h1>

      <section>
        {projects.map( (item, index) => (
          <p> {item.name} </p>
        ))}
      </section>

    </div>
  );
}

export default Portfolio;
